import React from 'react';
import './Profile2.css';
import Avatar from '../Images/avatar_prueba.jpg';

export default function Profile2() {
    return (
        <div>
            <div>
                <div>
                    <img src={Avatar} width="25%" height="25%" alt="Avatar"/>
                </div>
                <div></div>
                <div></div>
            </div>
        </div>
    )
}
